 CREATE TABLE IF NOT EXISTS authme (id INTEGER AUTO_INCREMENT,username VARCHAR(255) NOT NULL UNIQUE,password VARCHAR(255) NOT NULL,ip VARCHAR(40) NOT NULL,lastlogin BIGINT,x smallint(6) DEFAULT '0',y smallint(6) DEFAULT '0',z smallint(6) DEFAULT '0',email VARCHAR(255) NOT NULL,CONSTRAINT table_const_prim PRIMARY KEY (id));
